import image from '../images/icon-star.svg';

// import React from 'react';

import { Questions } from '../components/Questions.jsx';

 export function Container(){
    return (
        <>
       <section className='grid grid-rows-2 grid-cols-2 items-center justify-left p-[20px] mt-10 bg-white rounded w-[500px] '> 

        <div className='flex'>
        <img src={image} alt="star" className=" w-10 mr-5 h-[100px]"/>
        <h1 className="font-bold text-5xl row-span-1  h-[100px]">FAQs</h1>
        </div>
        <Questions /> 

       </section>

</>
    );
 }
